// function constructor for making sounds
function sound(src) {
  this.sound = document.createElement("audio");
  this.sound.src = src;
  this.sound.setAttribute("preload", "auto");
  this.sound.setAttribute("controls", "none");
  this.sound.style.display = "none";
  document.body.appendChild(this.sound);
  this.play = function () {
    this.sound.play();
  }
  this.stop = function () {
    this.sound.pause();
  }
}

function ai_check(x, y, isBlock) {
  var t = 40;
  if (isBlock) t = 50;
  var l = 0;
  while (l < s.length) {
    if (s[l].x > x || s[l].x + 5 > x) {
      if (s[l].x < x + t || s[l].x + 5 < x + t) {
        if (s[l].y > y || s[l].y + 5 > y) {
          if (s[l].y < y + t || s[l].y + 5 < y + t) {
            delete s[l]; // remove object from javascript memory for #lesslag
            s.splice(l, 1); // remove extra undefined from array(leftover from *delete s[l];*)
            return true;
          }
        }
      }
    }
    if (s[l].x < Game.borders[0] || s[l].x > Game.borders[1] || s[l].y < Game.borders[2] || s[l].y > Game.borders[3]) {
      delete s[l];
      s.splice(l, 1);
    }
    l++;
  }
  return false;
}
class Hitbox {

  constructor(owner, x, y, width, height) {
    this.owner = owner;
    this.width = width;
    this.x = x;
    this.y = y;
  }

  detect() {
    for (var l = 0; l < s[l].length; l++) {
      if ((this.x < s[l].x && this.x + this.width > s[l].x) && (this.y < s[l].y && this.y + this.height > s[l].y)) {
        delete s[l];
        s.splice(l, 1);
        this.owner.health -= s[l].damage;
      }
    }
  }

}

