function Block(health, x, y, isInvincible, isExplosive, isScaffolding) {
  this.blockId = b.length - 1;
  this.x = x;
  this.y = y;
  this.isScaffolding = isScaffolding;
  this.wall = function (x, y) {
    draw.drawImage(wall_image, x * 50, y * 50);
    if (this.health == undefined) {
      this.health = Infinity; this.type = 'wall';
    }
  }
  this.strong = function (x, y) {
    if (this.health == undefined) {
      this.health = 60;
      this.type = 'strong';
    }
    draw.strokeStyle = "#000000";
    draw.fillStyle = "#D3D3D3";
    draw.strokeRect(x * 50, y * 50, 50, 50);
    draw.fillRect(x * 50, y * 50, 50, 50);
    draw.beginPath();
    draw.moveTo(x * 50, y * 50);
    draw.lineTo(x * 50 + 10, y * 50 + 10);
    draw.lineTo(x * 50 + 40, y * 50 + 10);
    draw.lineTo(x * 50 + 50, y * 50 + 0);
    draw.stroke();
    draw.moveTo(x * 50, y * 50);
    draw.lineTo(x * 50 + 10, y * 50 + 10);
    draw.lineTo(x * 50 + 10, y * 50 + 40);
    draw.lineTo(x * 50, y * 50 + 50);
    draw.stroke();
    draw.moveTo(x * 50, y * 50 + 50);
    draw.lineTo(x * 50 + 10, y * 50 + 40);
    draw.lineTo(x * 50 + 40, y * 50 + 40);
    draw.lineTo(x * 50 + 50, y * 50 + 50);
    draw.stroke();
    draw.moveTo(x * 50 + 50, y * 50 + 50);
    draw.lineTo(x * 50 + 40, y * 50 + 40);
    draw.lineTo(x * 50 + 40, y * 50 + 10);
    draw.lineTo(x * 50 + 50, y * 50 + 0);
    draw.stroke();
  }
  this.weak = function (x, y) {
    if (this.health == undefined) {
      this.health = 20;
      this.type = 'weak';
    }
    draw.drawImage(weak_image, x * 50, y * 50);
  }
  i.push(window.setInterval(function () {
    var l = 0;
    while (l < b.length) {
      if (ai_check(b[l].x * 50, b[l].y * 50, true)) {
        draw.fillStyle = "#FF0000";
        draw.fillRect(b[l].x * 50, b[l].y * 50, 50, 50);
        b[l].health -= 10;
        if (b[l].health <= 0) {
          if (Game.level == 'multiplayer') {
            var strand = user.host.blockData[b[l].y + 10].split('');
            strand[b[l].x + 10] = ' ';
            user.host.blockData[b[l].y + 10] = strand.join('');
          }
          var q = 0;
          while (q < user.tank.scaffolding.length) {
            if (b[l].y == user.tank.scaffolding[q].y) {
              if (b[l].x == user.tank.scaffolding[q].x) {
                user.tank.scaffolding.splice(q, 1);
              }
            }
            q++;
          }
          block_support(l);
        }
      }
      l++;
    }
  }, 50));
}
